# Bug Fixes INI Patching Format
#==============================
#
#   #,address = data_big_endian_value
#
#   The # can be 1 to 4 bytes, or the special C operator to copy (requires range of addresses)
#   
# For conditional replacements, you can do:
#
#   #,address = (if_data_is_this)then_set_to_this
#   
# To write a value to a range of adresses [start,finish):
# The # must be +4 from the actual number of bytes.
#
#   #,start...finish = data_big_endian_value
#
# Copying mode looks like this:
#
#   C,start...finish = start2
#   
# All of the commands are processed in the order they appear in the INI file here.
# All addresses are specified as exactly 6 hex characters. 
# Commands of incorrect length, etc. will be completely ignored.
# THERE IS NO SUPPORT (YET) FOR CONDITIONAL BYTE RANGE OVERWRITING.
#   
###############################
